import React from 'react';
import styles from '../styles/Home.module.css'


const Card3 = (props) => {
    return (
        <div>

<div> 
  <img src={props.image} />
  <div>
    <h2>{props.name}</h2>
    <div>
      <p><b>Info</b>{props.info}</p>
    </div>
  </div>
</div>


        </div>
    );
};

export default Card3;
